import React from 'react';

import { Container, Title, PerfilPhoto } from './styles';

import perfilPhoto from './img/perfil.png';

function Home() {

    return (
        <Container>
            <Title>Bryn Diniz</Title>

            <PerfilPhoto src={perfilPhoto} />

        </Container>
    );
}

export default Home;
